import React, { Component } from 'react'

class LogoutComponent extends Component {
    render() {
        return (
            <>
                <h1>You are successfully logged out</h1>
                <div className="container">
                    Thank You.
                </div>
            </>
        )
    }
}

export default LogoutComponent
